  fb:m.05kkh fb:base.biblioness.bibs_location.country ?country .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?property WHERE {
  ?property fb:type.object.type fb:base.svocab.movie.movie .
  ?property fb:type.object.supertype * fb:award.award_nomination_announcement.award .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?product WHERE {
  ?product fb:type.object.type fb:type.object.product .
  ?product ?operation fb:m.0lwkh
}

