PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX geosparql: <http://www.opengis.net/ont/geosparql#>
ASK WHERE {
  fb:m.0ff0d geosparql:hasGeolocation ?geolocation .
  ?geolocation geosparql:lat 42.59 ; geosparql:long 103.43 .
}

